metadata.__description:
Веер Опахало для мангала Firewood предназначено для удобного раздува огня или углей. С таким небольшим аксессуаром вы сможете быстро нагнетать воздух, необходимый для горения углей в мангале. Веер изготовлен из мягкого полимера с эргономичными рукоятками для удобного хвата.

Преимущества:

- небольшой вес;
- простота эксплуатации;
- подходит для костра, мангала, барбекю;
- надолго сохраняет привлекательный внешний вид.
